d.csv\",show_col_types = FALSE)\n","daily_steps <- read_csv(\"../input/bellabeat-fitbit-datasets/dailySteps_merged.csv\",show_col_types = FALSE)\n","heart_rate_sec <- read_csv(\"../input/bellabeat-fitbit-datasets/heartrate_seconds_merged.csv\",show_col_types = FALSE)\n","minute_METs <- read_csv(\"../input/bellabeat-fitbit-datasets/minuteMETsNarrow_merged.csv\",show_col_types = FALSE)\n","sleep_day <- read_csv(\"../input/bellabeat-fitbit-datasets/sleepDay_merged.csv\",show_col_types = FALSE)\n","weight_log <- read_csv(\"../input/bellabeat-fitbit-datasets/weightLogInfo_merged.csv\",show_col_types = FALSE)"]},{"cell_type":"markdown","id":"085884ce","metadata":{"papermill":{"duration":0.035173,"end_time":"2021-12-24T21:39:12.903641","exception":false,"start_time":"2021-12-24T21:39:12.868468","status":"completed"},"tags":[]},"source":["## Process"]},{"cell_type":"code","execution_count":3,"id":"ae98d3cd","metadata":{"execution":{"iopub.execute_input":"2021-12-24T21:39:12.97971Z","iopub.status.busy":"2021-12-24T21:39:12.978283Z","iopub.status.idle":"2021-12-24T21:39:13.160424Z","shell.execute_reply":"2021-12-24T21:39:13.158895Z"},"papermill":{"duration":0.2213,"end_time":"2021-12-24T21:39:13.16057","exception":false,"start_time":"2021-12-24T21:39:12.93927","status":"completed"},"tags":[]},"outputs":[{"data":{"text/html":["<table class=\"dataframe\">\n","<caption>A tibble: 6 × 15</caption>\n","<thead>\n","\t<tr><th scope=col>Id</th><th scope=col>ActivityDate</th><th scope=col>TotalSteps</th><th scope=col>TotalDistance</th><th scope=col>TrackerDistance</th><th scope=col>LoggedActivitiesDistance</th><th scope=col>VeryActiveDistance</th><th scope=col>ModeratelyActiveDistance</th><th scope=col>LightActiveDistance</th><th scope=col>SedentaryActiveDistance</th><th scope=col>VeryActiveMinutes</th><th scope=col>FairlyActiveMinutes</th><th scope=col>LightlyActiveMinutes</th><th scope=col>SedentaryMinutes</th><th scope=col>Calories</th></tr>\n","\t<tr><th scope=col>&lt;dbl&gt;</th><